import React from 'react';
import { Button, TextField, Container, Typography } from '@mui/material';

const Admin = () => {
  return (
    <Container>
      <Typography variant="h4" component="h1" gutterBottom>
        Admin
      </Typography>
      <form>
        <TextField label="Título" fullWidth margin="normal" />
        <TextField label="Descrição" fullWidth margin="normal" />
        <TextField label="Categotia" fullWidth margin="normal" />
        <TextField label="Elenco" fullWidth margin="normal" />
        <TextField label="Cartaz" fullWidth margin="normal" />
        <Button variant="contained" color="primary" fullWidth>
          Adicionar Filme
        </Button>
      </form>
    </Container>
  );
};

export default Admin;
